void voicerec::thread_ap_NS_fsm() {
    switch (ap_CS_fsm.read().to_uint64()) {
        case 1 : 
            if ((!esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_0) && !esl_seteq<1,1,1>(tmp_s_fu_221_p2.read(), ap_const_lv1_0))) {
                ap_NS_fsm = ap_ST_st6_fsm_5;
            } else if ((!esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_0) && esl_seteq<1,1,1>(tmp_s_fu_221_p2.read(), ap_const_lv1_0))) {
                ap_NS_fsm = ap_ST_st2_fsm_1;
            } else {
                ap_NS_fsm = ap_ST_st1_fsm_0;
            }
            break;
        case 2 : 
            ap_NS_fsm = ap_ST_st3_fsm_2;
            break;
        case 4 : 
            if (!esl_seteq<1,1,1>(ap_const_logic_0, grp_voicerec_preprocessSound_fu_195_ap_done.read())) {
                ap_NS_fsm = ap_ST_st4_fsm_3;
            } else {
                ap_NS_fsm = ap_ST_st3_fsm_2;
            }
            break;
        case 8 : 
            if (!esl_seteq<1,1,1>(exitcond_fu_227_p2.read(), ap_const_lv1_0)) {
                ap_NS_fsm = ap_ST_st6_fsm_5;
            } else {
                ap_NS_fsm = ap_ST_st5_fsm_4;
            }
            break;
        case 16 : 
            if (!esl_seteq<1,1,1>(ap_const_logic_0, grp_voicerec_processChunk_fu_170_ap_done.read())) {
                ap_NS_fsm = ap_ST_st4_fsm_3;
            } else {
                ap_NS_fsm = ap_ST_st5_fsm_4;
            }
            break;
        case 32 : 
            if (!(esl_seteq<1,1,1>(tmp_s_reg_256.read(), ap_const_lv1_0) && esl_seteq<1,1,1>(ap_const_logic_0, grp_voicerec_classifySound_fu_153_ap_done.read()))) {
                ap_NS_fsm = ap_ST_st1_fsm_0;
            } else {
                ap_NS_fsm = ap_ST_st6_fsm_5;
            }
            break;
        default : 
            ap_NS_fsm =  (sc_lv<6>) ("XXXXXX");
            break;
    }
}

void voicerec::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"s_axi_voicerec_io_AWVALID\" :  \"" << s_axi_voicerec_io_AWVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"s_axi_voicerec_io_AWREADY\" :  \"" << s_axi_voicerec_io_AWREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_AWADDR\" :  \"" << s_axi_voicerec_io_AWADDR.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_WVALID\" :  \"" << s_axi_voicerec_io_WVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_WREADY\" :  \"" << s_axi_voicerec_io_WREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_WDATA\" :  \"" << s_axi_voicerec_io_WDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_WSTRB\" :  \"" << s_axi_voicerec_io_WSTRB.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_ARVALID\" :  \"" << s_axi_voicerec_io_ARVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_ARREADY\" :  \"" << s_axi_voicerec_io_ARREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_ARADDR\" :  \"" << s_axi_voicerec_io_ARADDR.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_RVALID\" :  \"" << s_axi_voicerec_io_RVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_RREADY\" :  \"" << s_axi_voicerec_io_RREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_RDATA\" :  \"" << s_axi_voicerec_io_RDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_RRESP\" :  \"" << s_axi_voicerec_io_RRESP.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_BVALID\" :  \"" << s_axi_voicerec_io_BVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"s_axi_voicerec_io_BREADY\" :  \"" << s_axi_voicerec_io_BREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_voicerec_io_BRESP\" :  \"" << s_axi_voicerec_io_BRESP.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"interrupt\" :  \"" << interrupt.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

